INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 7001, 0, "キャル", 106001, 1, "2015/12/17 15:00:00", 7, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 7002, 0, "コッコロ", 105901, 1, "2015/12/17 15:00:00", 7, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 7003, 0, "ペコリーヌ", 105801, 1, "2015/12/17 15:00:00", 7, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 10001, 0, "ペコリーヌ", 105801, 1, "2015/12/17 15:00:00", 10, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 10002, 0, "キャル", 106001, 1, "2015/12/17 15:00:00", 10, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 10003, 0, "コッコロ", 105901, 1, "2015/12/17 15:00:00", 10, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2104010, 1, "2030/12/17 14:59:59", 0.0, -363.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2, 10004, 0, "シェフィ", 106401, 1, "2015/12/17 15:00:00", 10, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -416.5, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 12001, 0, "ペコリーヌ", 105801, 1, "2015/12/17 15:00:00", 12, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 13001, 0, "キャル", 106001, 1, "2015/12/17 15:00:00", 13, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 13002, 0, "コッコロ", 105901, 1, "2015/12/17 15:00:00", 13, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2104010, 1, "2030/12/17 14:59:59", 0.0, -363.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2, 13003, 0, "シェフィ", 106401, 1, "2015/12/17 15:00:00", 13, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 13004, 0, "ペコリーヌ", 105801, 1, "2015/12/17 15:00:00", 13, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 14001, 0, "コッコロ", 105901, 1, "2015/12/17 15:00:00", 14, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2104010, 1, "2030/12/17 14:59:59", 0.0, -363.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2, 14002, 0, "シェフィ", 106401, 1, "2015/12/17 15:00:00", 14, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 14003, 0, "ペコリーヌ", 105801, 1, "2015/12/17 15:00:00", 14, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 14004, 0, "キャル", 106001, 1, "2015/12/17 15:00:00", 14, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -470.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 15001, 0, "コッコロ", 105901, 1, "2015/12/17 15:00:00", 15, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2104010, 1, "2030/12/17 14:59:59", 0.0, -363.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2, 16001, 0, "シェフィ", 106401, 1, "2015/12/17 15:00:00", 16, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 16002, 0, "ペコリーヌ", 105801, 1, "2015/12/17 15:00:00", 16, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 16003, 0, "キャル", 106001, 1, "2015/12/17 15:00:00", 16, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 16004, 0, "コッコロ", 105901, 1, "2015/12/17 15:00:00", 16, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 17002, 0, "コッコロ", 105901, 1, "2015/12/17 15:00:00", 17, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 17004, 0, "キャル", 106001, 1, "2015/12/17 15:00:00", 25, 0.0);
