INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2104010, 1, "2030/12/17 14:59:59", 0.0, -363.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2, 17006, 0, "シェフィ", 106401, 1, "2015/12/17 15:00:00", 25, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 17007, 0, "ペコリーヌ", 105801, 1, "2015/12/17 15:00:00", 25, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 18001, 0, "カリン", 190801, 1, "2015/12/17 15:00:00", 18, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 2, "2030/12/17 14:59:59", 0.0, -363.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 1, 18002, 0, "カリン", 190801, 1, "2015/12/17 15:00:00", 18, 0.0);
