INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 4, "2030/12/17 14:59:59", 0.0, -470.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, 19002, 0, "カリン", 190801, 1, "2015/12/17 15:00:00", 19, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 5, "2030/12/17 14:59:59", 0.0, -470.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, 20001, 0, "カリン", 190801, 1, "2015/12/17 15:00:00", 20, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 6, "2030/12/17 14:59:59", 0.0, -470.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, 20002, 0, "カリン", 190801, 1, "2015/12/17 15:00:00", 20, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 21001, 0, "キャル", 106001, 1, "2015/12/17 15:00:00", 21, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 21002, 0, "コッコロ", 105901, 1, "2015/12/17 15:00:00", 21, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2104010, 1, "2030/12/17 14:59:59", 0.0, -363.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2, 21003, 0, "シェフィ", 106401, 1, "2015/12/17 15:00:00", 21, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -363.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 21004, 0, "ペコリーヌ", 105801, 1, "2015/12/17 15:00:00", 21, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -430.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 22001, 0, "カリン", 190801, 1, "2015/12/17 15:00:00", 22, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 2, "2030/12/17 14:59:59", 0.0, -430.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, 22002, 0, "カリン", 190801, 1, "2015/12/17 15:00:00", 22, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 3, "2030/12/17 14:59:59", 0.0, -430.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, 23001, 0, "カリン", 190801, 1, "2015/12/17 15:00:00", 23, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 4, "2030/12/17 14:59:59", 0.0, -430.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, 23002, 0, "カリン", 190801, 1, "2015/12/17 15:00:00", 23, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 4.08, -385.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 24001, 10011, "エリコ（バレンタイン）", 109001, 2, "2019/01/31 12:00:00", 24, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 2, "2030/12/17 14:59:59", 5.0, -385.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 1, 24002, 10011, "エリコ（バレンタイン）", 109001, 2, "2019/01/31 12:00:00", 24, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 3, "2030/12/17 14:59:59", 10.11, -385.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 1, 24003, 10011, "エリコ（バレンタイン）", 109001, 2, "2019/01/31 12:00:00", 24, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 4, "2030/12/17 14:59:59", 4.0, -385.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 1, 24004, 10011, "エリコ（バレンタイン）", 109001, 2, "2019/01/31 12:00:00", 24, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 5, "2030/12/17 14:59:59", 6.0, -385.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 1, 24005, 10011, "エリコ（バレンタイン）", 109001, 2, "2019/01/31 12:00:00", 24, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 6, "2030/12/17 14:59:59", 0.0, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, 24006, 10011, "エリコ（バレンタイン）", 109002, 1, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 7, "2030/12/17 14:59:59", 0.0, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, 24007, 10011, "エリコ（バレンタイン）", 109002, 1, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 8, "2030/12/17 14:59:59", 0.0, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, 24008, 10011, "エリコ（バレンタイン）", 109002, 1, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 9, "2030/12/17 14:59:59", 0.0, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, 24009, 10011, "エリコ（バレンタイン）", 109002, 1, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 10, "2030/12/17 14:59:59", 0.0, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, 24010, 10011, "エリコ（バレンタイン）", 109002, 1, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 2.12, -385.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 24011, 10011, "シズル（バレンタイン）", 109101, 2, "2019/01/31 12:00:00", 24, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 2, "2030/12/17 14:59:59", 4.19, -385.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 5, 24012, 10011, "シズル（バレンタイン）", 109101, 2, "2019/01/31 12:00:00", 24, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 3, "2030/12/17 14:59:59", 2.3, -385.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2, 24013, 10011, "シズル（バレンタイン）", 109101, 4, "2019/01/31 12:00:00", 24, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 4, "2030/12/17 14:59:59", 0.0, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, 24014, 10011, "シズル（バレンタイン）", 109102, 1, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 5, "2030/12/17 14:59:59", 5.23, -385.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 24015, 10011, "シズル（バレンタイン）", 109101, 2, "2019/01/31 12:00:00", 24, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 6, "2030/12/17 14:59:59", 0.0, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, 24016, 10011, "シズル（バレンタイン）", 109102, 1, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 7, "2030/12/17 14:59:59", 5.01, -385.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 1, 24017, 10011, "シズル（バレンタイン）", 109101, 2, "2019/01/31 12:00:00", 24, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 8, "2030/12/17 14:59:59", 0.0, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, 24018, 10011, "シズル（バレンタイン）", 109102, 1, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 9, "2030/12/17 14:59:59", 0.0, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, 24019, 10011, "シズル（バレンタイン）", 109102, 1, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 10, "2030/12/17 14:59:59", 0.0, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, 24020, 10011, "シズル（バレンタイン）", 109102, 1, "2019/01/31 12:00:00", 24, 0.0);
