INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 2, "2030/12/17 14:59:59", 0.0, -416.5, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 1, 43005, 0, "アメス", 123001, 1, "2015/12/17 15:00:00", 44, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 3, "2030/12/17 14:59:59", 5.79, -416.5, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 1, 43006, 0, "アメス", 123001, 2, "2015/12/17 15:00:00", 45, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -371.5, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 1, 46001, 0, "アメス", 123001, 1, "2015/12/17 15:00:00", 46, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 0.0, -416.5, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 2, 47001, 0, "シズル", 104901, 2, "2015/12/17 15:00:00", 47, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (0, 1, "2030/12/17 14:59:59", 9.32, -416.5, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 1, 47002, 0, "リノ", 101101, 2, "2015/12/17 15:00:00", 47, 0.0);
